object.script:
function onTick() currentDelta = input.getNumber(1) DeltaSum = input.getNumber(2)+currentDelta counter = input.getNumber(3)
updateDeltaSum = false
if counter==60 then updateDeltaSum = true end output.setNumber(1, DeltaSum) output.setBool(1, updateDeltaSum) end

function onTick() Drossel = input.getNumber(1) UD = input.getNumber(2)
if math.abs(UD) > 0.5 then if UD < 0 then Drossel = math.max(Drossel-0.01, 0) end if UD > 0 then Drossel = math.min(Drossel+0.01, 1) end end
output.setNumber(1, Drossel) end

function onTick() currentDelta = input.getNumber(1) DeltaSum = input.getNumber(2)+currentDelta counter = input.getNumber(3) timersize = input.getNumber(4)
updateDeltaSum = false
if counter==60*timersize then updateDeltaSum = true end output.setNumber(1, DeltaSum) output.setBool(1, updateDeltaSum) end
